<urn:paradicms_etl:pipeline:Bildungsroman:model:c26c07435436696ef447f74d3ce162e002f50a40189ebe29a6637bf92e641cce> {
<urn:markdown:Bildungsroman:work:Niklaus%20Wirth%20-%20Lilith%20workstation> a paradicms:Work;
    dcterms:creator <urn:markdown:Bildungsroman:person:Niklaus%20Wirth>;
    dcterms:relation <https://www.wikidata.org/wiki/Q278299>;
    dcterms:abstract _:n3-1;
    dcterms:title "Niklaus Wirth - Lilith workstation";
    paradicms:collection <urn:markdown:Bildungsroman:collection:default>;
    paradicms:institution <urn:markdown:Bildungsroman:institution:default>.
_:n3-1 a paradicms:Text;
    dcterms:creator <urn:markdown:Bildungsroman:person:Niklaus%20Wirth>;
    dcterms:rights <http://rightsstatements.org/vocab/InC/1.0/>;
    dcterms:bibliographicCitation "Niklaus Wirth. 1985. From programming language design to computer construction. Commun. ACM 28, 2 (Feb. 1985), 160â€“164. DOI:https://doi.org/10.1145/2786.2789";
    rdf:value "<blockquote>\n<p>Every single project was primarily a <strong>learning experiment</strong>. One learns best when inventing. Only by actually doing a development project can I gain enough familiarity with the intrinsic difficulties and enough confidence  that the inherent details can be mastered. I never could  separate the design of a language from its implementation, for a rigid definition without the feedback from  the construction of its compiler would seem to me presumptuous and unprofessional. Thus, I participated in  the construction of compilers, circuity, and text and  graphics editors, and this entailed microprogramming,  much high-level programming, circuit design, board  layout, and even wire wrapping. This may seem odd,  but I simply like hands-on experience much better than  team management. I have also learned that researchers  accept leadership from a factual, in-touch team member much more readily than from an organization expert, be he a manager in industry or a university professor. I try to keep in mind that teaching by setting a  good example is often the most effective method and  sometimes the only one available.</p>\n<p>Lastly, each of these projects was carried through by the enthusiasm and the desire to succeed in the knowledge that the endeavor was worthwhile. This is perhaps the most essential but also the most elusive and subtle prerequisite.</p>\n</blockquote><p>Niklaus Wirth, <em>From Programming Language Design to Computer Construction</em></p>"
}
