    dcterms:creator <urn:markdown:Bildungsroman:person:Maurice%20Wilkes>;
    dcterms:rights <http://rightsstatements.org/vocab/InC/1.0/>;
    dcterms:bibliographicCitation "Maurice V. Wilkes. Computers then and now. ACM Turing award lectures. Association for Computing Machinery, New York, NY, USA, 1967. DOI:https://doi.org/10.1145/1283920.1283922";
    rdf:value "<blockquote>\n<p>Although a mathematician, Turing took quite an interest in the engineering side of computer design. There was some discussion in 1947 as to whether a cheaper substance than mercury could not be found for use as an ultrasonic delay medium. Turing's contribution to this discussion was to advocate the use of gin, which he said contained alcohol and water in just the right proportions to give a zero temperature coefficient of propagation velocity at room temperature.</p>\n</blockquote><p>Maurice Wilkes, <em>Computers Then and Now</em></p>"
}
